import styled from "styled-components";

const List = () => {
  return (
    <Lists>
        <Content>ddd</Content>
        <Content>ddd</Content>
        <Content>ddd</Content>
        <Content>ddd</Content>
        <Content>ddd</Content>
        <Content>ddd</Content>
    </Lists>
  )}

  
export default List;

const Lists = styled.ul`
    width: 100vw;
    display: flex;
    overflow-x: auto;
    overflow-y: hidden;
    white-space: nowrap;
`
const Content = styled.li`
    width: 100vw;
`
